    // Change:     
    function getStoredData() {
      if (window.user && window.user.locations) {
             
        let locations = JSON.parse(localStorage.getItem('locations'))
        console.debug('Locations', locations)
        console.debug('Locations Length', Object.keys(window.user.locations).length)     
        if (locations !== null) {
          if (locations === window.user.locations) {
            console.debug('Store hasnt changed')
            return;
          }
          console.debug('Setting locations')
          window.user.locations = locations;
          window.user.gameLocationsCount = Object.keys(window.user.locations).length;  
        }
      }       
      if (window.mapData && window.mapData.maxMarkedLocations) {
        window.mapData.maxMarkedLocations = 100000;
      }   
      

      if (window.user && window.user.presets) {
        let presets = JSON.parse(localStorage.getItem('presets'));

          if(presets !== null){
              window.user.presets = presets;
            }
        }
    }

    function returnStoredPresets(){
        let presets = JSON.parse(localStorage.getItem('presets'));
        if (window.user && window.user.presets) {
    
              if(presets !== null){
                  window.user.presets = presets;
                }
            }

            return presets || null;

    }

    function storeData() {
      console.log('Storing location data')
      if (window.user && window.user.locations) {      
        localStorage.setItem('locations', JSON.stringify(window.user.locations))
      }      
    }

    function storeDataPresets() {
        console.log('Storing location data')
        if (window.user && window.user.presets) {      
          localStorage.setItem('presets', JSON.stringify(window.user.presets))
        }      
      }

